import React from 'react';
    import { cn } from "../../lib/utils"

    interface TableProps extends React.HTMLAttributes<HTMLTableElement> {}
    const Table = React.forwardRef<HTMLTableElement, TableProps>(({ className, children, ...props }, ref) => (
        <table ref={ref} className={cn("border-collapse border border-gray-200", className)} {...props}>{children}</table>
    ));
    Table.displayName = "Table";

    interface TableHeaderProps extends React.HTMLAttributes<HTMLTableSectionElement>{}
    const TableHeader: React.FC<TableHeaderProps> = ({ className, children }) => <thead className={className}>{children}</thead>;

    interface TableBodyProps extends React.HTMLAttributes<HTMLTableSectionElement>{}
    const TableBody: React.FC<TableBodyProps> = ({ className, children }) => <tbody className={className}>{children}</tbody>;

    interface TableRowProps extends React.HTMLAttributes<HTMLTableRowElement>{}
    const TableRow: React.FC<TableRowProps> = ({ className, children, ...props }) => <tr className={className} {...props}>{children}</tr>;

    interface TableCellProps extends React.TdHTMLAttributes<HTMLTableCellElement>{}

    const TableCell: React.FC<TableCellProps> = ({ className, children, ...props }) => (
        <td className={cn("border border-gray-200 px-4 py-2", className)} {...props}>{children}
        </td>
    );
    interface TableHeadProps extends React.ThHTMLAttributes<HTMLTableHeaderCellElement>{}
    const TableHead: React.FC<TableHeadProps> = ({ className, children, ...props }) => (
        <th className={cn("border border-gray-200 px-4 py-2 font-semibold", className)} {...props}>{children}
    </th>
    );

    export { Table, TableHeader, TableBody, TableRow, TableCell, TableHead };
